package myleetcode;

import java.util.HashMap;
import java.util.List;
import java.util.ArrayList;
import java.util.Map;

public class IsSubsequence {
	static Map<String, Boolean> matchMap = new HashMap<String, Boolean>();
	
	static public boolean isSubSequence(String s, String t){
		if(s==null || s.isEmpty())
			return true;
		if(t==null || t.isEmpty())
			return false;
		if(matchMap.containsKey(s))
			return matchMap.get(s);
		int i=0, j=0;
		while(i<s.length() && j<t.length()){
			if(s.charAt(i) != t.charAt(j))
				j++;
			else
				i++;
		}
		if(i==s.length()){
			matchMap.put(s, true);
			return true;
		}
		else{
			matchMap.put(s, false);
			return false;
		}
	}
	
	ArrayList<Integer>[] letterPos = new ArrayList[256];
	public boolean method2(String s, String t){
		if(s==null || s.isEmpty())
			return true;
		if(t==null || t.isEmpty())
			return false;
		
		for(int i=0; i<t.length(); i++){
			if(letterPos[(int)t.charAt(i)]==null)
				letterPos[(int)t.charAt(i)] = new ArrayList<Integer>();
			letterPos[(int)t.charAt(i)].add(i);
		}
		
		int minpos = 0;
		for(int i=0; i<s.length(); i++){
			if(letterPos[(int)t.charAt(i)]==null)
				return false;
			List<Integer> tmp = letterPos[(int)t.charAt(i)];
			int j=0;
			for( j=0; j<tmp.size(); j++)
				if(tmp.get(j)>= minpos)
					break;
			if(j==tmp.size())
				return false;
			else
				minpos = tmp.get(j)+1;
		}
		return true;
	}
	
	
	static public void main(String args[]){
		String s = new String("leeeeetcode");
		String t = new String("");
		isSubSequence(s, t);
	}
}
